import React from 'react'

const imageSearch = (props) => {
    return (
        <div>
            <form onSubmit={props.handleGetRequest}>
                <input type="text" autoComplete="off" name="searchValue" placeholder="Image search"/>
                <button>Click here to search</button>
            </form>
        </div>
    )
}

export default imageSearch
